CREATE TABLE "NMT2"."INN_KONVOLUTT"
(
    EBMESSAGE_ID varchar2(80) PRIMARY KEY NOT NULL,
    MOTTAK_ID varchar2(50),
    AVTALE_ID varchar2(50) NOT NULL,
    SERVICE varchar2(50) NOT NULL,
    ACTION varchar2(50) NOT NULL,
    FROM_EBCOMNAME varchar2(255),
    FROM_EBORGNUMBER varchar2(50),
    FROM_EBDN varchar2(1024),
    FROM_ROLE varchar2(50) NOT NULL,
    TO_EBCOMNAME varchar2(255),
    TO_EBORGNUMBER varchar2(50),
    TO_EBDN varchar2(1024),
    TO_ROLE varchar2(50) NOT NULL,
    EBCONVERS_ID varchar2(80) NOT NULL,
    EBTIMESTAMP timestamp NOT NULL,
    REF2_EBMESSAGE_ID varchar2(80),
    EBRELIAB_MODE varchar2(50) NOT NULL,
    EBSEC_PROFILE varchar2(50) NOT NULL,
    FROM_EBHER varchar2(35),
    TO_EBHER varchar2(35),
    SYNCHRONOUS NUMBER DEFAULT 0,
    FROM_EBENHNUMBER varchar2(50),
    TO_EBENHNUMBER varchar2(50)
);

